import Vue from 'vue'
import Router from 'vue-router'
import home from '@/components/HomeH'
import quemsou from '@/components/QuemSou'
import oquefaco from '@/components/OQueFaco'
import hobbies from '@/components/HobbieS'

Vue.use(Router)
export default new Router({
  routes: [
    {
      path: '/',
      name: 'home',
      component: home
    },
    {
      path: '/quemsou',
      name: 'quemsou',
      component: quemsou
    },
    {
      path: '/oquefaco',
      name: 'oquefaco',
      component: oquefaco
    },
    {
      path: '/hobbies',
      name: 'hobbies',
      component: hobbies
    }
  ]
})
